    else
        ss[1] = string.sub(txt, 1, 1)
        txt = string.sub(txt, 2)
        txt:gsub( Mf({46,46,63}),function(n)ss[#ss + 1] = n end)
    end
    for i = 1, #ss do
        if string.len(ss[i]) == 1 then
            ss[i] = Mf({48}) .. ss[i]
        end
    end
    str = Mf({})
    for i = #ss, 1, -1 do
        str = str .. ss[i]
    end
